#cenario carrega na memoria 1001; cenario estatico guardado na memoria 1003
#npc guardados na memoria 1003
# $15 onde ta o navio

main:	lui $8, 0x1001 # carregar o cenario na memoria 1001 no $8
	lui $24, 0x1003 # guardar o cenario na memoria 1003 no $24
	jal carregar

	addi $13, $0, 1 #navio ir pdireita
	addi $14, $0, 0 #navio ir pesquerda
	addi $19, $0, 0 #movimento aviao
	addi $23, $0, 2 #direcao aviao
	
delay:	beq $15, 25000, npc #tempo de um segundo
	addi $15, $15, 1
	j delay
			
	#mostrar navio na tela
npc:	lui $8, 0x1001 #cenario
	lui $15, 0x1002 # personagens guardados na memoria 1002 no $15
	addi $15, $15, -32768 #512x256; proporcao 4x4; o local armazenado eh 0x10010000 + 32768(0x10018000) -> 0x10020000 - 32768
	
	lui $24, 0x1003 # cenario estatico guardado na memoria 1003 no $24
	addi $8, $8, 9900 #navio inicia nessa posicao
	addi $24, $24, 9900
	addi $10, $0, 84 #qtd bits a partir de 0x10018000 pra mostrar o navio; 84: qtd de vezes que vai repetir pra mostrar na tela
	addi $12, $0, 14 #qtd colunas do navio
	addi $16, $0, 6 #verifica que linha esta preenchida
	add $8, $8, $14 #la do naviodireita; trecho que faz o navio se mover
	add $t8, $t8, $14 # ^^^^
	jal navio

contadornavio:
	beq $13, $0, navioesquerda #se $13 recebe 0, o navio vai pra esquerda
	beq $13, 1, naviodireita #se $13 recebe 1, o navio vai p direita
	
	#mostrar aviao na tela 
contadorinicial:
	lui $8, 0x1001 #cenario
	lui $15, 0x1001 #personagens
	addi $15, $15, 33104 # 0x10018000 + (84*4) = 0x10018150
	
	lui $24, 0x1003 #cenario estatico pra substituir
	addi $8, $8, 23796
	addi $t8, $t8, 23796
	addi $10, $0, 42 #qtd bits a partir de 0x10018150 pra mostrar o aviao; 42: qtd vezes que vai repetir pra mostrar na tela
	addi $12, $0, 7 #qtd colunas do aviao; A CADA 7 COLUNAS, ELE PULA LINHA
	addi $20, $0, 0
	lui $21, 0xffff
	lw $18, 4($21)
	beq $18, 100, direita
	beq $18, 97, esquerda
	
contadoraviao:
	add $8, $8, $19
	add $t8, $t8, $19
	addi $16, $0, 6 #contator pra verificar que linha esta sendo preenchida
	jal aviao
	
contadoraviao2:
	beq $22, 1, trajeto

fazeraviao:
	addi $15, $0, 0
	lui $21, 0xffff
	sw $0, 4($21)
	j delay
	
fim:	addi $2, $0, 10
	syscall
	
navio:  beq $12, $0, proxlinha #PULA A LINHA QUANDO REPETIR AS 14 COLUNAS DO NAVIO
	lw $11, 0($15)
	beq $11, 0x000000ff, prox
	sw $11, 0($8)
	addi $8, $8, 4 #posicao 1001 cenario
	addi $24, $24, 4 #posicao 1003 cenario estatico
	addi $15, $15, 4 #posicao 1002 npc
	addi $10, $10, -1 #bits
	addi $12, $12, -1 #colunas
	beq $10, $0, volta
	j navio
	
clear:	beq $13, $0, clear2 #se $13 for 0 o navio vai p direita, se for 1, esquerda
	jal verificar #este rotulo vai checar em qual linha estah
	add $8, $8, $17 # $8 - cenario
	add $t8, $t8, $17
	lw $9, 0($t8)
	sw $9, 0($8)
	sub $8, $8, $17
	sub $t8, $t8, $17
	j pula

clear2:	jal verificar2
	add $8, $8, $17
	add $t8, $t8, $17
	lw $9, 0($t8)
	sw $9, 0($8)
	sub $8, $8, $17
	sub $t8, $t8, $17
	j pula

prox:	addi $8, $8, 4 #CENARIO APRESENTANDO
	addi $24, $24, 4 #CENARIO RECUPERADO
	addi $15, $15, 4 #PULA PRA O PROX BIT
	addi $10, $10, -1 #CONTADOR BIT
	addi $12, $12, -1 # CONTADOR COLUNA
	beq $10, $0, volta
	j navio
	
proxlinha: beq $25, 1, clear #verifica se nao eh a primeira vez q o navio chegou...
			     #...a primeira vez q o navio for, o $25 vai ser 0 -> posicao inicial
			     #qnd nao for mais a 1 vez, ele vai p o rotulo "clear"
pula:	addi $12, $12, 14
	addi $8, $8, 456 #corrigir, no ta pulando linha p desenhar 
	addi $24, $24, 456
	addi $s0, $s0, -1
	beq $10, $0, volta
	j navio
	
volta: 	addi $25, $0, 1 #qnd o navio finalizar a volta, este rotulo vai adicionar a $25 o valor 1, indicando que o navio andou
	beq $13, 1, volta2
	lw $9, 0($t8)
	sw $9, 0($8)
	j contadornavio
	
volta2: lw $9, -60($t8)
	sw $9, 60($8)
	j contadornavio

verificar: #limpando da esq p dir
	beq $16, 6, colunaseis #6
	beq $16, 5, colunaseis #6
	beq $16, 4, colunatres #3
	beq $16, 3, colunadois #2
	beq $16, 2, zerado #13
	beq $16, 1, zerado #13 #corrigir, no ta limpando
	addi $17, $0, 0
	jr $31
	
verificar2: # limpando da dir p esq
	beq $16, 6, colunaqualquer #qq
	beq $16, 5, colunaqualquer #qq
	beq $16, 4, colunaonze #11
	beq $16, 3, colunadoze #12
	beq $16, 2, zerado #0
	beq $16, 1, zerado #0 #nao ta limpando 
	addi $17, $0, 0
	jr $31

zerado:
	addi $17, $0, 0
	jr $31
colunaum:
	addi $17, $0, -60
	jr $31
colunadois:
	addi $17, $0, -56
	jr $31
colunatres:
	addi $17, $0, -52
	jr $31
colunaquatro:
	addi $17, $0, -48
	jr $31
colunaseis:
	addi $17, $0, -36
	jr $31
colunaqualquer:
	addi $17, $0, -20
	jr $31
colunasete:
	addi $17, $0, 28
	jr $31
colunaonze:
	addi $17, $0, -12
	jr $31
colunadoze:
	addi $17, $0, -8
	jr $31
colunatreze:
	addi $17, $0, -4
	jr $31
 
 #AVIAO
 
aviao:  beq $12, 0, proxlinha2
	lw $11, 0($15)
	beq $11, 0x000000ff, proxaviao
	sw $11, 0($8)
	addi $8, $8, 4
	addi $24, $24, 4
	addi $15, $15, 4
	addi $10, $10, -1
	addi $12, $12, -1
	beq $10, $0, voltaaviao
	j aviao
	
cleaning:
	add $8, $8, $20
	add $t8, $t8, $20
	lw $9, 0($t8)
	sw $9, 0($t8)
	sub $9, $9, $20
	sub $t8, $t8, $20
	j pula2

proxaviao: addi $8, $8, 4
	addi $24, $24, 4
	addi $15, $15, 4
	addi $10, $10, -1
	addi $12, $12, -1
	beq $10, $0, voltaaviao
	j aviao
	
proxlinha2: 
	beq $18, 100, verificar3
	beq $18, 97, verificar4

pula2:	addi $12, $0, 7 #qtd colunas do aviao
	addi $8, $8, 484
        addi $24, $24, 484
        addi $16, $16, -1
        beq $10, $0, voltaaviao
	j aviao

voltaaviao: 
	beq $18, 100, voltaaviao2
	lw $9, -8($t8)
	sw $9, -8($8)
	lw $9, -16($t8)
	sw $9, -16($8)
	jr $31
voltaaviao2:
	lw $9, -24($t8)
	sw $9, -24($8)
	lw $9, 16($t8)
	sw $9, -16($8)
	jr $31

verificar3:
	beq $16, 6, colunatresaviao
	beq $16, 5, colunadoisaviao
	beq $16, 4, colunazeroaviao
	beq $16, 3, colunatresaviao
	beq $16, 2, colunatresaviao
	j cleaning

verificar4:
	beq $16, 6, colunacincoaviao
	beq $16, 5, colunaseisaviao
	beq $16, 4, colunaoitoaviao
	beq $16, 3, colunacincoaviao
	beq $16, 2, colunacincoaviao
	j cleaning

colunazeroaviao:
	addi $20, $0, -32
	j cleaning
colunadoisaviao:
	addi $20, $0, -24
	j cleaning
colunatresaviao:
	addi $20, $0, -20
	j cleaning
colunacincoaviao:
	addi $20, $0, -12
	j cleaning
colunaseisaviao:
	addi $20, $0, -8
	j cleaning
colunaoitoaviao:
	addi $20, $0, 0
	j cleaning

#DIRECAO NAVIO

navioesquerda:
	beq $14, -20, mudardirecao #O NAVIO ANDA -20 BITS A ESQUERDA E MUDA A DIRECAO
	addi $14, $14, -4
	j contadorinicial
	
naviodireita:
	beq $14, 140, mudardirecao #o navio anda 140 bits a direita, ao final, ele muda a direcao
	addi $14, $14, 4
	j contadorinicial

mudardirecao:
	xor $13, $13, 1
	j contadorinicial
	
direita:
	addi $19, $19, 4
	addi $23, $23, 1
	j contadoraviao
	
esquerda:
	addi $19, $19, -4
	addi $23, $23, 0
	j contadoraviao

tiro:	beq $22, 1, contadoraviao
	addi $22, $8, -1012
	addi $29, $29, -4
	sw $22, 0($29)
	addi $22, $0, 1
	addi $29, $29, 4
	j contadoraviao
	
trajeto:
	addi $18, $0, 0x00ffd700
	addi $29, $29, -8
	beq $22, 0x00ffd700, sumir
	addi $22, $22, -512
	add $16, $0, 0x000000ff
	sw $16, 512($22)
	sw $16, 0($22)
	sw $22, 0($29)
	addi $29, $29, 8
	addi $22, $0, 1
	addi $16, $0, 6
	j fazeraviao
	
sumir:	lw $12, 0($22)
	beq $12, 0x00ff0000, atingiu
	addi $12, $0, 0x000000ff
	sw $12, 0($22)
	addi $12, $0, 7
	addi $29, $29, 8
	j fazeraviao
	
atingiu:
	lw $12, 4($29)
	addi $12, $12, 1
	sw $12, 4($29)
	addi $12, $0, 0x000000ff
	sw $12, 0($22)
	addi $12, $0, 7
	addi $29, $29, 8
	j fazeraviao
	
carregar:
	lw $9, 0($8) #$9 LIVRE PRA CARREGAR
	sw $9, 0($24)
	sw $9, 0($8)
	addi $8, $8, 4
	addi $24, $24, 4
	addi $10, $10, 1
	bne $10, 8192, carregar # 8192 = quantidade de vezes que vai apresentar
	jr $31
